import React from 'react';
import { Container, Button, Form, FormControl } from "react-bootstrap";
//align-items-center
import 'bootstrap/dist/css/bootstrap.min.css';
function Userprofile(){
    const username = 'Bob';
    return(
            <Container className="py-3">
                <h3>Welcome, {username}</h3>
                <div className='text-center'><Button variant="info">Advertise on platform</Button></div>
                <div className='manageProfile w-25'> 
                    <h5>Profile</h5>
                    <Form className='d-flex py-1'>
                        <FormControl type="text" value={'contact'} className="mr-sm-2" />
                        <Button variant="outline-success">&#128393;</Button>
                    </Form>
                        
                    <Form className='d-flex py-1'>
                        <FormControl type="text" value={'password'} className="mr-sm-2" />
                        <Button variant="outline-success">&#128393;</Button>
                    </Form>
                </div>


            </Container>

    );
}
export { Userprofile };
